import {Link} from 'react-router-dom';
import icon from "../../icons/youtube.svg"
export default function Header() {



    return (
        <header className="bg-gray-200 flex flex-col justify-start items-start md:flex-row " >
            <Link to="/">
                <div className="text-center m-2 p-2 flex"> 
                <img style={{width:"30px"}} src={icon} alt=""/> <span className="mx-3">NotYoutube</span></div>
        </Link>


        </header>
    )
}
